def factorial(n):
    return 1 if n == 0 else n * factorial(n - 1)
print(factorial(5))

def fibonacci(n):
    a, b = 0, 1
    for _ in range(n):
        print(a, end=" ")
        a, b = b, a + b
print(fibonacci(10))

def count_vowels(s):
    return sum(1 for c in s.lower() if c in "aeiou")
print(count_vowels("hello world"))

